INSERT INTO `blog_post` VALUES ('New Blog & Help Page','<p>Hey all! It\'s Solo Espero here, creator of this website. I\'ve created this blog to give update notes about what I\'ve added.</p>\r\n<p>With this update, I\'ve added a new Help page, which can be found from the home page. The Help page gives some helpful advice as to how to use Clash&nbsp;Tracker if its your first time using it. That and this new blog are the main components about this update. There were also various minor changes I added, such as fixing timing issues, styling issues on the player page, etc. that I\'m sure you wouldn\'t want me to bore you with.</p>\r\n<p>Until next time, Clash on!</p>','2016-04-08 20:55:46');
